import React, {Component} from 'react';
import './ProviderItem.css'

class ProviderItem extends Component {
    render() {
        let {imageURL, title, desc} = this.props;
        return (
            <div className="col-md-3 category-item">
                <img
                    src=""
                    className=""
                    alt="Thiết Kế Nội Thất"
                />
                <a>
                    <h3>Thiết Kế Nội Thất</h3>
                </a>
                <p>Nội thất HomeGroup là một trong những công
                    ty tốt nhất trong lĩnh vực Thiết kế và Thi công Nội thất. Đội ngũ kiến trúc sư nhiều
                    năm kinh nghiệm sẽ làm hài lòng quý khách hàng.</p>
            </div>
        );
    }
}

export default ProviderItem;
